import axios from 'axios'
import React, { useEffect, useState } from 'react'

const Api = () => {

const [results, setresults]=useState([])

useEffect(()=>{
    axios.get('https://hn.algolia.com/api/v1/search?query=react')
    .then((response)=>{
        console.log(response)
        setresults(response.data)
    });
},[]);

  return (
    <div>{results}</div>
  )
}

export default Api
